import React, { useState, useEffect } from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css';
import { FaBars, FaTimes, FaLink, FaTrash } from 'react-icons/fa';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

export default function App() {
  const [urls, setUrls] = useState([{ longUrl: '', validity: 30, shortcode: '' }]);
  const [shortLinks, setShortLinks] = useState([]);
  const [menuOpen, setMenuOpen] = useState(false);

  useEffect(() => {
    AOS.init({ duration: 1000 });
  }, []);

  const generateShortcode = () => {
    const charset = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';
    let code = '';
    for (let i = 0; i < 6; i++) {
      const randomIndex = Math.floor(Math.random() * charset.length);
      code += charset[randomIndex];
    }
    return code;
  };

  const validateUrl = (url) => {
    try {
      const parsedUrl = new URL(url.startsWith('http') ? url : `http://${url}`);
      return parsedUrl.hostname.includes('.') || parsedUrl.protocol.startsWith('http');
    } catch {
      return false;
    }
  };

  const handleShorten = () => {
    const newLinks = [];
    const existingShortcodes = new Set(shortLinks.map(link => link.shortcode));

    for (let item of urls) {
      if (!validateUrl(item.longUrl)) {
        alert(`Invalid URL: ${item.longUrl}`);
        return;
      }

      let code = item.shortcode.trim() || generateShortcode();
      while (existingShortcodes.has(code)) {
        code = generateShortcode();
      }

      existingShortcodes.add(code);

      newLinks.push({
        longUrl: item.longUrl,
        shortcode: code,
        validity: parseInt(item.validity) || 30,
        shortUrl: `http://localhost:3000/${code}`,
        timestamp: new Date().toLocaleString()
      });
    }

    setShortLinks(prev => [...prev, ...newLinks]);
    setUrls([{ longUrl: '', validity: 30, shortcode: '' }]);
  };

  const handleInputChange = (index, field, value) => {
    setUrls(prev => {
      const updated = [...prev];
      updated[index][field] = value;
      return updated;
    });
  };

  const addUrlField = () => {
    setUrls(prev => prev.length < 5 ? [...prev, { longUrl: '', validity: 30, shortcode: '' }] : prev);
  };

  const removeShortLink = (index) => {
    setShortLinks(prev => prev.filter((_, i) => i !== index));
  };

  const Home = () => (
    <div className="container" data-aos="fade-up">
      <h2>URL Shortener</h2>
      {urls.map((item, idx) => (
        <div className="url-input" key={idx}>
          <input type="text" placeholder="Enter Long URL" value={item.longUrl} onChange={(e) => handleInputChange(idx, 'longUrl', e.target.value)} />
          <input type="number" placeholder="Validity (minutes)" value={item.validity} onChange={(e) => handleInputChange(idx, 'validity', e.target.value)} />
          <input type="text" placeholder="Custom Shortcode (optional)" value={item.shortcode} onChange={(e) => handleInputChange(idx, 'shortcode', e.target.value)} />
        </div>
      ))}
      <button className="btn" onClick={handleShorten}>Shorten URLs</button>
      <button className="btn add-btn" onClick={addUrlField}>Add URL Field</button>

      <div className="result" data-aos="zoom-in">
        {shortLinks.map((link, idx) => (
          <div className="short-link" key={idx}>
            <FaLink className="icon" />
            <a href={link.longUrl} target="_blank" rel="noopener noreferrer">{link.shortUrl}</a>
            <span>({link.validity} mins)</span>
            <span className="timestamp">{link.timestamp}</span>
            <FaTrash className="delete-icon" onClick={() => removeShortLink(idx)} />
          </div>
        ))}
      </div>
    </div>
  );

  const Analytics = () => (
    <div className="analytics" data-aos="fade-in">
      <h2>Analytics Overview</h2>
      <p className="analytics-count">Total Shortened URLs: <strong>{shortLinks.length}</strong></p>
      <ul>
        {shortLinks.map((link, idx) => (
          <li key={idx} className="analytics-item">
            <span>{link.shortUrl}</span> - <em>{link.timestamp}</em>
          </li>
        ))}
      </ul>
    </div>
  );

  const About = () => (
    <div className="about" data-aos="fade-up">
      <h2>About Shortly</h2>
      <p>This is a simple URL shortening service built with React. Customize, manage, and analyze your short links with ease.</p>
    </div>
  );

  return (
    <Router>
      <div className="app">
        <nav className="navbar">
          <h1 className="logo">Shortly</h1>
          <div className="menu-icon" onClick={() => setMenuOpen(!menuOpen)}>
            {menuOpen ? <FaTimes /> : <FaBars />}
          </div>
          <ul className={menuOpen ? 'nav-links active' : 'nav-links'}>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/analytics">Analytics</Link></li>
            <li><Link to="/about">About</Link></li>
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/analytics" element={<Analytics />} />
          <Route path="/about" element={<About />} />
        </Routes>

        <style jsx>{`
          body {
            margin: 0;
            background: #121212;
            color: #fff;
            font-family: 'Poppins', sans-serif;
          }

          .navbar {
            display: flex;
            justify-content: space-between;
            align-items: center;
            padding: 15px 30px;
            background: #1f1f1f;
            box-shadow: 0 4px 10px rgba(0,0,0,0.6);
            position: sticky;
            top: 0;
            z-index: 1000;
          }

          .logo:hover {
            transform: scale(1.1);
            color: #00bcd4;
          }

          .menu-icon:hover {
            transform: rotate(90deg);
            color: #00bcd4;
          }

          .nav-links {
            display: flex;
            list-style: none;
            gap: 20px;
          }

          .nav-links li:hover {
            color: #00bcd4;
            transform: scale(1.1);
          }

          .container, .analytics, .about {
            padding: 30px 20px;
            max-width: 900px;
            margin: auto;
            animation: fadeIn 0.8s ease-in;
          }

          .url-input {
            display: grid;
            grid-template-columns: 1fr 120px 180px;
            gap: 12px;
            margin-bottom: 15px;
          }

          input, .btn {
            border-radius: 8px;
            border: none;
          }

          .btn {
            padding: 12px 25px;
            background-color: #00bcd4;
            color: #fff;
            margin-top: 15px;
            cursor: pointer;
            transition: transform 0.3s, background-color 0.3s;
          }

          .btn:hover {
            background-color: #0097a7;
            transform: translateY(-2px);
          }

          .short-link {
            background: #1e1e1e;
            padding: 12px;
            border-radius: 8px;
            margin-bottom: 12px;
            box-shadow: 0 4px 10px rgba(0,0,0,0.4);
            display: flex;
            align-items: center;
            gap: 10px;
          }

          .short-link a {
            color: #00bcd4;
            text-decoration: none;
            font-weight: bold;
          }

          .timestamp {
            font-size: 0.8rem;
            color: #bbb;
          }

          .analytics {
            text-align: center;
          }

          .analytics-count {
            font-size: 1.2rem;
            margin-bottom: 20px;
            color: #00bcd4;
          }

          .analytics-item {
            margin: 5px 0;
          }

          @keyframes fadeIn {
            from { opacity: 0; transform: translateY(20px); }
            to { opacity: 1; transform: translateY(0); }
          }

        `}</style>
      </div>
    </Router>
  );
}
